// css
import "../assets/scss/header.scss";

import React, { Component } from "react";

export const Header = ({
  title,
  linkName1,
  link1,
  linkName2,
  link2,
  linkName3,
  link3,
  imageLink,
  image
}) => {
  return (
    <header className="header">
      <div className="header-content">
        <h1>{title}</h1>
        <ul>
          <li className="active">
            <a href={link1}>{linkName1}</a>
          </li>
          <li>
            <a href={link2}>{linkName2}</a>
          </li>
          <li>
            <a href={link3}>{linkName3}</a>
          </li>
          <a href={imageLink} target="_blank" className="appstore-badge">
            <img
              alt="Download button that leads to the App Store"
              src={image}
            />
          </a>
        </ul>
      </div>
    </header>
  );
};
